import { useEffect, useState } from "react"
import { useParams } from "react-router";
import { findAntique, updateAntique } from "../../utils/api";
import ErrorAlert from "../commonFiles/ErrorAlert";

export default function EditAntique(){
    
    const [errors,setErrors] = useState(null);
    const [antique,setAntique] = useState(null);
    const [form,setForm] = useState([])
    const {id} = useParams();

useEffect(()=>{
    async function loadAntique(){
        let ac= new AbortController();
        try{
            console.log("tryblock loadAntique ",antique)
            const SingleAntique = await findAntique(id,ac.signal)
            setForm(SingleAntique)
        } catch(err){setErrors(err)}
        return ()=> ac.abort();
    }
    loadAntique();
},[id])



console.log(form,"edit Antique antique")
 const changeHandler = e =>{
     setForm({...form,[e.target.name]:e.target.value})
    }
    
    async function submitHandler(form){
        const ac = new AbortController();
        try{
            await updateAntique(form,ac.signal);
            console.log("updated antique ",id)
        } catch(err){
            setErrors(err);
            throw err;
        }
        return ()=> ac.abort
    }

    return (
    <div>

    <div className="form-container">
    <h3 className="title-container">Edit Your Antique</h3>
    <form onSubmit={(e)=>{
        e.preventDefault();
        console.log('submit Clicked',form)
        submitHandler(form);
        // setForm(initialFields)
        // navigate.push('/antiques')
    }}>
        
    <div className="inputList-container">
      <div className="inputList-line"><p className="inputList-label">Id: </p>          <input id="id"         name="id"          type="text" placeholder="ID"          className="inputList-input" onChange={changeHandler} value={form.id}          maxLength="20"    aria-label="category input box" />    </div> 
      <div className="inputList-line"><p className="inputList-label">Category: </p>    <input id="category"   name="category"    type="text" placeholder="Category"    className="inputList-input" onChange={changeHandler} value={form.category}    maxLength="20"    aria-label="category input box" />    </div> 
      <div className="inputList-line"><p className="inputList-label">Quantity: </p>    <input id="quantity"   name="quantity"    type="text" placeholder="Quantity"    className="inputList-input" onChange={changeHandler} value={form.quantity}    maxLength="20"    aria-label="quantity input box" />    </div> 
      <div className="inputList-line"><p className="inputList-label">Name: </p>        <input id="name"       name="name"        type="text" placeholder="Name"        className="inputList-input" onChange={changeHandler} value={form.name}        maxLength="20"    aria-label="name input box" />        </div> 
      <div className="inputList-line"><p className="inputList-label">Value: </p>       <input id="value"      name="value"       type="text" placeholder="Value"       className="inputList-input" onChange={changeHandler} value={form.value}       maxLength="20"    aria-label="value input box" />       </div> 
      <div className="inputList-line"><p className="inputList-label">Material: </p>    <input id="material"   name="material"    type="text" placeholder="Material"    className="inputList-input" onChange={changeHandler} value={form.material}    maxLength="20"    aria-label="material input box"/>     </div> 
      <div className="inputList-line"><p className="inputList-label">Color: </p>       <input id="color"      name="color"       type="text" placeholder="Color"       className="inputList-input" onChange={changeHandler} value={form.color}       maxLength="20"    aria-label="color input box" />       </div> 
      <div className="inputList-line"><p className="inputList-label">Style: </p>       <input id="style"      name="style"       type="text" placeholder="Style"       className="inputList-input" onChange={changeHandler} value={form.style}       maxLength="20"    aria-label="style input box" />       </div> 
      <div className="inputList-line"><p className="inputList-label">Brand: </p>       <input id="brand"      name="brand"       type="text" placeholder="Brand"       className="inputList-input" onChange={changeHandler} value={form.brand}       maxLength="20"    aria-label="brand input box" />       </div> 
      <div className="inputList-line"><p className="inputList-label">Model: </p>       <input id="model"      name="model"       type="text" placeholder="Model"       className="inputList-input" onChange={changeHandler} value={form.model}       maxLength="20"    aria-label="model input box" />       </div> 
      <div className="inputList-line"><p className="inputList-label">Time Period: </p> <input id="timePeriod" name="timePeriod"  type="text" placeholder="Time Period" className="inputList-input" onChange={changeHandler} value={form.timePeriod}  maxLength="20"    aria-label="time period input box" /> </div> 
      <div className="inputList-line"><p className="inputList-label">Condition: </p>   <input id="condition"  name="condition"   type="text" placeholder="Condition"   className="inputList-input" onChange={changeHandler} value={form.condition}   maxLength="20"    aria-label="condition input box" />   </div> 
      <div className="inputList-line"><p className="inputList-label">Origin: </p>      <input id="origin"     name="origin"      type="text" placeholder="Origin"      className="inputList-input" onChange={changeHandler} value={form.origin}      maxLength="20"    aria-label="origin input box" />      </div> 
